import React from 'react';

// Events is called in App.js where the route been defined
// @to-do
const Event = () => {
	if (props.id === null) {
		return (
			<div className="center">
				<Card>
					<h2>Not a valid event.</h2>
				</Card>
			</div>
		);
	}

	return (
		<ul className="event-list">
			{props.items(event => (
				<EventItem
					key={event.id}
					id={event.id}
					image={event.image}
					name={event.name}
					detail={event.detail}
				/>
			))}
		</ul>
	);
};

export default Event;
